import React from 'react';
import ReactDOM from 'react-dom';

const CarouselItems = [
    {
      "imgName" : "carousel-item active",
      "imgsrc" : "/images/Beach/img1.jpg",
      "imgalt" : "beach1",
      "caption" : "iuuadf",
      "href" : "#",
      "indicators" : {
                    "target" : "#beach",
                    "slideto" : "0",
                    "className" : "active"
      }
    },
    {
      "imgName" : "carousel-item",
      "imgsrc" : "/images/Beach/img2.jpg",
      "imgalt" : "beach2",
      "caption" : "jirkklsfh",
      "href" : "#",
      "indicators" : {
                    "target" : "#beach",
                    "slideto" : "1",
                    "className" : ""
      }
    },
    {
    "imgName" : "carousel-item",
    "imgsrc" : "/images/Beach/img3.jpg",
    "imgalt" : "beach3",
    "caption" : "jirkklsfh",
    "href" : "#",
    "indicators" : {
                  "target" : "#beach",
                  "slideto" : "2",
                  "className" : ""
    }
  }
]
export default CarouselItems;
